{
  "ubx_message": {
    "name": "UBX-MGA-ACK",
    "description": "Multiple GNSS acknowledge message",
    "message_type": "output",
    "class_id": "0x13",
    "message_id": "0x60",
    "payload_length": {
      "fixed": 8
    },
    "payload_structure": [
      {
        "byte_offset": 0,
        "name": "type",
        "data_type": "U1",
        "description": "Type of acknowledgment: 0: The message was not used by the receiver (see infoCode field for an indication of why) 1: The message was accepted for use by the receiver (the infoCode field will be 0)"
      },
      {
        "byte_offset": 1,
        "name": "version",
        "data_type": "U1",
        "description": "Message version (0x00 for this version)",
        "fixed_value": 0
      },
      {
        "byte_offset": 2,
        "name": "infoCode",
        "data_type": "U1",
        "description": "Provides greater information on what the receiver chose to do with the message contents: 0: The receiver accepted the data 1: The receiver does not know the time so it cannot use the data (To resolve this a UBX-MGA-INI-TIME_UTC message should be supplied first) 2: The message version is not supported by the receiver 3: The message size does not match the message version 4: The message data could not be stored to the database 5: The receiver is not ready to use the message data 6: The message type is unknown"
      },
      {
        "byte_offset": 3,
        "name": "msgId",
        "data_type": "U1",
        "description": "UBX message ID of the acknowledged message"
      },
      {
        "byte_offset": 4,
        "name": "msgPayloadStart",
        "data_type": {
          "array_of": "U1",
          "count": 4
        },
        "description": "The first 4 bytes of the acknowledged message's payload"
      }
    ]
  }
}
